    {
      prop: 'fallbackRender',
      type: '(props: FallbackProps) => ReactNode',
      description: '替代组件的渲染函数',
      required: false,
    },
    {
      prop: 'onError',
      type: '(error: Error, info: { componentStack: string }) => void',
      description: '错误捕获回调函数',
      required: false,
    },
    {
      prop: 'onReset',
      type: '() => void',
      description: '重置时触发的回调',
      required: false,
    },
    {
      prop: 'resetKeys',
      type: 'Array<any>',
      description: '变化时会触发重置的依赖数组',
      required: false,
    },
  ];

  const propsColumns = [
    {
      title: '属性名',
      dataIndex: 'prop',
      key: 'prop',
      width: 150,
      render: (text: string) => <Text code>{text}</Text>,
    },
    {
      title: '类型',
      dataIndex: 'type',
      key: 'type',
      width: 200,
      render: (text: string) => <Text type="secondary">{text}</Text>,
    },
    {
      title: '说明',
      dataIndex: 'description',
      key: 'description',
    },
    {
      title: '必填',
      dataIndex: 'required',
      key: 'required',
      width: 80,
      render: (required: boolean) => <Tag color={required ? 'red' : 'green'}>{required ? '是' : '否'}</Tag>,
    },
  ];

